import React from "react";

class Navigation extends React.Component {
    constructor() {
        super();
        this.state = {
            hideNavigation: false
        };
        this.handleChange = this.handleChange.bind(this);
    }

    handleChange(e) {
        this.setState({ hideNavigation: true });
    }
    render() {
        const style = this.state.hideNavigation ? { display: 'none' } : {};
        return (
            <div className="navigation">
                <div className="nav" onClick={this.handleChange}>
                    <img className="nav-icon" src="./icons/icons_compare.png" alt="hi" />
                    <div className="nav1"></div>
                    <div className="nav2"></div>
                </div>
                <div className="nav-menu" style={style}>

                </div>
            </div>
        )
    }
}

export default Navigation;
